    async getBlockConfirmationByTransactionHash(txHash) {
        return this.#api.getBlockConfirmationByTransactionHash(txHash);
    }
    async getZkAppTransactionByTxHash(txHash) {
        return this.#api.getZkAppTransactionByTxHash(txHash);
    }
    ensureConnection() {
        if (!this.isConnected) {
            throw new Error('Please connect to mina network first');
        }
    }
